export const getFavs = () => {
  if (typeof window !== "undefined")
    return JSON.parse(localStorage.getItem("favs") as string);
  return [];
};

export const setFavs = (items) => {
  return localStorage && localStorage.setItem("favs", JSON.stringify(items));
};
